import styled from 'styled-components';
import { colors } from '../GlobalStyle.styled';

export const NotFound = styled.div`
  margin: 90px;
  height: 105px;
  width: 460px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 24px;
  background-color: ${colors.BLACK};
  color: ${colors.WHITE};
`
